    function macdFunction(chartArr, num, arr1, arr2) {
      const macd = chartArr[num].emaTwelve - chartArr[num].emaTwentySix;
      chartArr[num].macd = macd.toFixed(2); // CALCULATE SIGNAL LINE ----------------

